  <header className="header">
    <div className="logo">
      <Link to="/"><img src={logo} alt="Logo" /></Link> 
    </div>

    <nav className="navbar">
      <Link to="/Concept">Le concept</Link>
      <Link to="/testIA">Tester notre IA</Link>
